import React from "react";
import classes from "./CartItem.module.css";

const CartItem = (props) => {
  return (
    <React.Fragment>
      <li className={classes.itemlist}>
        <span>
          <div>{props.name}</div>
          <span>{props.price}</span>
          <span>{props.amount}</span>
        </span>
      </li>
      <hr />
    </React.Fragment>
  );
};

export default CartItem;
